WHERE  ( aerinfo_record_id  in (SELECT RECORD_ID FROM  $$TGT_DB_NAME.$$LSDB_TRANSFM.LSMV_SAFETY_MASTER_DELETION_TMP  WHERE TABLE_NAME='lsmv_aer_info') OR msg_record_id  in (SELECT RECORD_ID FROM  $$TGT_DB_NAME.$$LSDB_TRANSFM.LSMV_SAFETY_MASTER_DELETION_TMP  WHERE TABLE_NAME='lsmv_message') OR recpt_record_id  in (SELECT RECORD_ID FROM  $$TGT_DB_NAME.$$LSDB_TRANSFM.LSMV_SAFETY_MASTER_DELETION_TMP  WHERE TABLE_NAME='lsmv_receipt_item') OR saftyrpt_record_id  in (SELECT RECORD_ID FROM  $$TGT_DB_NAME.$$LSDB_TRANSFM.LSMV_SAFETY_MASTER_DELETION_TMP  WHERE TABLE_NAME='lsmv_safety_report')
)
--AND 'I' = (SELECT PARAM_NAME FROM $$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_ETL_CONFIG WHERE TARGET_TABLE_NAME ='LOAD_CONTROL')
AND 'NO'=(SELECT CHAR_PARAM_VALUE FROM $$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_ETL_CONFIG WHERE TARGET_TABLE_NAME ='HISTORY_CONTROL' AND PARAM_NAME='KEEP_HISTORY');

UPDATE  $$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_SAFETY_MASTER 
SET EXPIRY_DATE=CURRENT_DATE()-1
FROM 	$$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_SAFETY_MASTER_TMP 
WHERE 	TO_DATE(LS_DB_SAFETY_MASTER.PROCESSING_DT) < TO_DATE(LS_DB_SAFETY_MASTER_TMP.PROCESSING_DT)
AND LS_DB_SAFETY_MASTER.INTEGRATION_ID = LS_DB_SAFETY_MASTER_TMP.INTEGRATION_ID
AND LS_DB_SAFETY_MASTER.recpt_RECORD_ID = LS_DB_SAFETY_MASTER_TMP.recpt_RECORD_ID
AND LS_DB_SAFETY_MASTER.EXPIRY_DATE = TO_DATE('9999-31-12','YYYY-DD-MM')
AND MD5(NVL(LS_DB_SAFETY_MASTER.aerinfo_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM')) ||'-'||NVL(LS_DB_SAFETY_MASTER.saftyrpt_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM')) ||'-'||NVL(LS_DB_SAFETY_MASTER.recpt_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM')) ||'-'||NVL(LS_DB_SAFETY_MASTER.msg_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM')) ) <> MD5(NVL(LS_DB_SAFETY_MASTER_TMP.aerinfo_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM'))||'-'||NVL(LS_DB_SAFETY_MASTER_TMP.saftyrpt_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM'))||'-'||NVL(LS_DB_SAFETY_MASTER_TMP.recpt_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM'))||'-'||NVL(LS_DB_SAFETY_MASTER_TMP.msg_DATE_MODIFIED ,TO_DATE('1900-01-01','YYYY-DD-MM')))
AND 'YES'=(SELECT CHAR_PARAM_VALUE FROM $$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_ETL_CONFIG WHERE TARGET_TABLE_NAME ='HISTORY_CONTROL' AND PARAM_NAME='KEEP_HISTORY')	
;


UPDATE  $$TGT_DB_NAME.$$LSDB_TRANSFM.LS_DB_SAFETY_MASTER TGT
SET 	TGT.EXPIRY_DATE=CURRENT_DATE()
